import Card from "./Card"

function CardList ({ cards }) {
    //create a variable to display the cards with the cards prop
    //that was passed down
    //iterate through cards and pass it down to card so we can 
    //render each card individually
    const displayCards = cards.map(card => <Card card={ card } key={ card.id }/>)
    return(
        <div class>
            {displayCards}
        </div>
    )
}
export default CardList
